    return (
        <nav className="container bg-secondary d-flex align-items-center justify-content-between">
            <div className="row">
                <Link to={"/"} className="text-decoration-none">Home</Link>
                <Link to={"/contacts/"} className="text-decoration-non">Create New recode</Link>
            </div>
        </nav>
    )
}

export default Nav
